import React from "react";
import ReactDOM from "react-dom";
import './Style.css';
import Card from "./Card.jsx";
import sdata from "./Sdata.jsx";

function ncards(val){
return(<div className="">
<Card 
    src={val.src}
    title={val.title}
    details={val.details}

/>
</div>

);
}

ReactDOM.render(
<> 
{sdata.map(ncards)}
 </>,
  document.getElementById("root")
);
